import React, { Component } from 'react';
import { Map, Marker } from "pigeon-maps"

class Geolocalizacao extends React.Component {

    constructor(props) {
        super(props);
    }

    posicao = [-29.671424, -51.1148032,12];

    render() {
        return (
            <Map height={300} defaultCenter={this.posicao} defaultZoom={1015}>
                <Marker width={50} anchor={this.posicao} />
            </Map>
        );
    }
}

export default Geolocalizacao;
